import React from "react";

const Box = (props) => {
  return (
    <div>
      <div className="box">
        <h1>{props.title}</h1>
        <img
          className="item-img"
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS8koGHkkb04TpSTwILD3b4sew42Z6500F6Cg&usqp=CAU"
        />
        <h2>WIN</h2>
      </div>
      <div>
        <button>가위</button>
        <button>바위</button>
        <button>보</button>
      </div>
    </div>
  );
};

export default Box;
